/**
 * This an ugly thing.
 * Since I inject the main script inside the page (as a content script) I can't make a request to website that doesn't add
 * the header "Access-Control-Allow-Origin". Which is the case of maps.googleapis.com/maps/api/geocode/json
 * So I can't query directly from the main script (enhance-su.js).
 *
 * The only solution is to use the javascript API. The bad things is that this api, by default, use document.write to create the script tag.
 * As a matter of fact, Chrome doesn't allow extension to use this method.
 * There an issue about that: https://code.google.com/p/gmaps-api-issues/issues/detail?id=4201
 *
 * The only solution I found, was to create a file from what the Google Map API will write.
 * It ended with this ugly file. But it works :)
 *
 * Source (for the top readable part)
 * https://maps.googleapis.com/maps/api/js?v=3&sensor=false
 *
 * Source (for the unreadable botton part)
 * https://maps.gstatic.com/intl/fr_fr/mapfiles/api-3/14/13/main.js
 */

